import logo from './logo.svg';
import './App.css';
import React from "react";

class Container extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
      company: undefined
    }
  }

  render() {
      const placeholderCompany = "Cafe Crystal Method";
      if (!this.state.company){
          this.setState({
              company: placeholderCompany,
          })
      }
    return(
        <div>
          <h1>{this.props.company}</h1>
        </div>
    )
  }
}
function App() {
  return (
    <div className="App">
        <header className="App-header">Cafe Crystal Method</header>
      <div className="App-main">
        <img src={logo} className="App-logo" alt="logo" />
        <Container company="Cafe Crystal Method" />
      </div>
        <div className="App-components">
            <ul>
                <li>Orders</li>
                <li>Menu</li>
                <li>Recipes</li>
                <li>Employees</li>
            </ul>
        </div>
    </div>

  );
}

export default App;
